//Global Key Press
document.body.addEventListener('keydown', function(e){
	//Break if search box is focused or x-ray is off (except plus key)
	var searchInput = document.querySelector('input[type=search]');
	if ((searchInput != null && document.activeElement == searchInput) || (e.keyCode != 187 && e.keyCode != 27 && !xRay) || (document.getElementById("close-player-btn")&&e.keyCode!=27)) return;
	var ctrlPressed = ((e.ctrlKey && !/Mac/.test(navigator.platform))||(e.metaKey && /Mac/.test(navigator.platform)));
	switch (e.keyCode) {
		case 27:
			if (!(window.fullScreen) && !(window.innerWidth == screen.width && window.innerHeight == screen.height) && (document.getElementById("close-player-btn"))) {
				document.getElementById("close-player-btn").click();
			}
			break;
		case 187: //Plus key (Activate x-ray)
			if (ctrlPressed) break;
			//Toggle the x-ray variables
			if (event.key == "+") {
				xray('toggle-status');
			} else {
				if (xRay) xray('click-action', true);
			}
			break;
		case 189: //Minus Key (Change x-ray view)
			if (ctrlPressed) break;
			if (event.key == "-" && xRay) xray('toggle-show');
			break;
		case 46: //Delete Key (delete selected tiles)
			if (ctrlPressed) break;
			document.querySelectorAll('.xSelected').forEach(function(s){
				s.remove();
			});
			break;
		case 65: //Letter A (Ctrl+a = select all tiles)
			if (ctrlPressed){
				e.preventDefault();
				document.querySelectorAll('.project-card').forEach(function(s){
					if(s.id != "ae_web_info") s.classList.add('xSelected');
				});
			}
			break;
		case 67: //Letter C (Copy all links + clear selection)
			if (document.querySelectorAll('.xSelected').length > 0) e.preventDefault();
			if (ctrlPressed) {
				if (document.querySelectorAll('.xSelected').length > 0) copy(document.querySelectorAll('.xSelected').repeatEach((s)=>{return ((e.shiftKey)?"https://awesome-e.github.io/hs-tools/play-project/?id=":"https://c.gethopscotch.com/p/")+s.id;}).join(" \n"));
			} else {
				document.querySelectorAll('.xSelected').forEach(function(s){
					s.classList.remove('xSelected');
				});
			}
			break;
		case 72: //Letter H (toggle hide status for selection)
			if (ctrlPressed) break;
			document.querySelectorAll('.xSelected').forEach(function(s){
				s.setAttribute('data-show', String(s.getAttribute('data-show') == 'false'));
			});
			break;
		case 75: //Letter K (Alt+k = keep only the selected cards)
			if (ctrlPressed) break;
			if (e.altKey) {
				document.querySelectorAll('.project-card:not(.xSelected)').forEach(function(s){
					s.remove();
				});
			}
			break;
		case 79: //Letter O (Alt+o = open all in new tabs)
			if (ctrlPressed) break;
			if (e.altKey) {
				var popupsBlocked = 0;
				document.querySelectorAll('.xSelected').forEach(function(s){
					var newWin = window.open('https://c.gethopscotch.com/p/' + s.id);
					if(!newWin || newWin.closed || typeof newWin.closed=='undefined') { 
						popupsBlocked ++;
					}
				});
				if (popupsBlocked > 0) alert("In order for the open projects function to work properly, you must allow the site to open pop-ups.");
			}
			break;
		case 80: //Letter P (Alt+p = open all code in new tabs)
			if (ctrlPressed) break;
			if (e.altKey) {
				var popupsBlocked = 0;
				document.querySelectorAll('.xSelected').forEach(function(s){
					var newWin = window.open('https://c.gethopscotch.com/api/v1/projects/' + s.id);
					if(!newWin || newWin.closed || typeof newWin.closed=='undefined') { 
						popupsBlocked ++;
					}
				});
				if (popupsBlocked > 0) alert("In order for the open projects' code function to work properly, you must allow the site to open pop-ups.");
			}
			break;
	}
});

//X-Ray
var xRay = false;
var xRayClickAction = 6;
var xRayView = 0;
	(xRayClickAction == 0) ? xRayClickAction = 6 : xRayClickAction --;
	xray('click-action');
if (CSS.supports('(-moz-appearance:none)')) document.querySelector('.xray-contents input').disabled = true;
if (JSON.parse(localStorage.getItem("preferences")||"{}")["x-ray_default"]) xray("toggle-status");

function xray(action, keyIn) {
	keyIn = keyIn||false;
	switch (action) {
		case 'toggle-status':
			xRay = !xRay;
			if (xRay) {
				document.documentElement.style.setProperty('--x-ray-elms', 'block');
				document.body.classList.add("xray");
				(xRayView == 0) ? xRayView = 2 : xRayView --;
				xray('toggle-show');
			} else {
				document.querySelector('#xray-show-btn').innerHTML = '<i class="fa fa-fw fa-eye"> </i>';
				document.body.classList.remove("xray");
				document.documentElement.style.setProperty('--x-ray-elms', 'none');
				document.documentElement.style.setProperty('--x-ray-show', 'ignore');
				document.documentElement.style.setProperty('--x-ray-opacity', 'ignore');
			}
			break;
		case 'toggle-show':
			(xRayView == 2) ? xRayView = 0 : xRayView ++;
			//var s = document.documentElement.style.getPropertyValue('--x-ray-show');
			switch (xRayView) {
				case 0:
					document.querySelector('#xray-show-btn').innerHTML = '<i class="fa fa-fw fa-eye"> </i>';
					document.documentElement.style.setProperty('--x-ray-show', 'ignore');
					document.documentElement.style.setProperty('--x-ray-opacity', '1');
					break;
				case 1:
					document.querySelector('#xray-show-btn').innerHTML = '<i class="fa fa-fw fa-low-vision fa-flip-horizontal"> </i>';
					document.documentElement.style.setProperty('--x-ray-show', 'ignore');
					document.documentElement.style.setProperty('--x-ray-opacity', '0.25');
					break;
				case 2:
					document.querySelector('#xray-show-btn').innerHTML = '<i class="fa fa-fw fa-eye-slash"> </i>';
					document.documentElement.style.setProperty('--x-ray-show', 'none');
					document.documentElement.style.setProperty('--x-ray-opacity', '0');
					break;
			}
			break;
		case 'click-action':
			(xRayClickAction == 7) ? xRayClickAction = 0 : xRayClickAction ++;
			switch (xRayClickAction) {
				case 0:
					document.querySelector('#xray-clickact-btn').innerHTML = '<i class="fa fa-fw fa-safari"> </i>';
					break;
				case 1:
					if (false /* SKIP */&& keyIn && prompt('Access Code') == 'GitCurating') {
						document.querySelector('#xray-clickact-btn').innerHTML = '<i class="fa fa-fw fa-save"> </i>';
					} else {
						document.querySelector('#xray-clickact-btn').innerHTML = '<i class="fa fa-fw fa-info-circle"> </i>';
						xRayClickAction ++;
					}
					break;
				case 2:
					document.querySelector('#xray-clickact-btn').innerHTML = '<i class="fa fa-fw fa-info-circle"> </i>';
					break;
				case 3:
					document.querySelector('#xray-clickact-btn').innerHTML = '<i class="fa fa-fw fa-pencil"> </i>';
					break;
				case 4:
					document.querySelector('#xray-clickact-btn').innerHTML = '<i class="fa fa-fw fa-remove"> </i>';
					break;
				case 5:
					document.querySelector('#xray-clickact-btn').innerHTML = '<i class="fa fa-fw fa-terminal"> </i>';
					break;
				case 6:
					document.querySelector('#xray-clickact-btn').innerHTML = '<i class="fa fa-fw fa-window-maximize"> </i>';
					break;
				case 7:
					document.querySelector('#xray-clickact-btn').innerHTML = '<i class="fa fa-fw fa-external-link"> </i>';
					break;
			}
			break;
	}
}

var xRaySelect = {
	"start_uuid": null,
	"end_uuid": null
};

function xProjectAction(p,e) {
	p = JSON.parse(p.replace(/\t+|\s+|\f+|\n+/g,' '));
	if ((e.metaKey && /Mac/.test(navigator.platform)) || e.ctrlKey) {
		//Command key on Mac or ctrl key on other platforms
		$('#' + p.uuid).toggleClass("xSelected");
		xRaySelect.start_uuid = p.uuid;//($('#' + p.uuid).hasClass("xSelected")) ? p.uuid : '';
		xRaySelect.end_uuid = null;
	} else if (e.shiftKey) {
		//$('#' + p.uuid).toggleClass("xSelected");
		$.fn.isAfter = function(sel) {
			return this.prevAll(sel).length !== 0;
		}
		$.fn.isBefore = function(sel) {
			return this.nextAll(sel).length !== 0;
		}
		//Select the appropriate tiles
		if (p.uuid != xRaySelect.start_uuid) {
			if ($(".flex").find("#" + xRaySelect.start_uuid).hasClass("xSelected")) { //If the starting project is selected
				//Remove Start to End
				if ($(".flex").find("#" + xRaySelect.start_uuid).isBefore("#" + xRaySelect.end_uuid)) {
					$(".flex").find("#" + xRaySelect.start_uuid).nextUntil("#" + xRaySelect.end_uuid).addBack().next().addBack().removeClass("xSelected");
				} else {
					$(".flex").find("#" + xRaySelect.end_uuid).nextUntil("#" + xRaySelect.start_uuid).addBack().next().addBack().removeClass("xSelected");
				}
				//Select Start to Current
				if ($(".flex").find("#" + xRaySelect.start_uuid).isBefore("#" + p.uuid)) {
					$(".flex").find("#" + xRaySelect.start_uuid).nextUntil("#" + p.uuid).addBack().next().addBack().addClass("xSelected");
				} else {
					$(".flex").find("#" + p.uuid).nextUntil("#" + xRaySelect.start_uuid).addBack().next().addBack().addClass("xSelected");
				}
			} else {
				//Remove Start to Current
				if ($(".flex").find("#" + xRaySelect.start_uuid).isBefore("#" + p.uuid)) {
					$(".flex").find("#" + xRaySelect.start_uuid).nextUntil("#" + p.uuid).addBack().next().addBack().removeClass("xSelected");
				} else {
					$(".flex").find("#" + p.uuid).nextUntil("#" + xRaySelect.start_uuid).addBack().next().addBack().removeClass("xSelected");
				}
			}
			//Set End UUID to current
			xRaySelect.end_uuid = p.uuid;
		}
	} else if (e.altKey) {
		$('#' + p.uuid).remove();
	} else {
		switch (xRayClickAction) {
			case 0:
				location.href = "https://c.gethopscotch.com/p/" + p.uuid;
				break;
			case 1:
				alert('This action is not ready yet');
				break;
			case 2:
				customReq('http://c.gethopscotch.com/api/v1/projects/' + p.uuid, function(result){
					p = JSON.parse(result);
					var r = Math.round(result.length/10)/100;
					var alertText = "Hopscotch Web Explorer Version: v" + explorerVersion +
									"\nTitle: " + p.title +
									"\nFiltered: " + p.has_been_removed +
									`\nMade by: ${p.user.nickname||p.author}\u202D (user id: ${(p.user != undefined) ? p.user.id : 'unknown'}) ` + 
									((p.original_user != undefined && p.original_user.id != p.user.id) ? `\nRemixed from: ${p.original_user.nickname}\u202D (user id: ${p.original_user.id}) ` : '') +
									"\nProject UUID: " + p.uuid +
									"\nFile ID: " + (p.filename||'').replace(/\.hopscotch/, '') + " (" + ((r < 1000) ? r + "KB)" : Math.round(r/10)/100 + "MB)") +
									"\n❤ " + p.number_of_stars + "  ▶ " + p.play_count +
									"  🔀 " + p.project_remixes_count + "  📰 " + p.published_remixes_count +
									"\nAbout 1 like per " + Math.round((p.play_count||1)/p.number_of_stars||0) + " plays (" + (Math.round(p.number_of_stars/p.play_count*10000)/100||0) + "%)" +
									"\n" + (Math.round(p.published_remixes_count/(p.published_remixes_count+p.project_remixes_count)*10000)/100||0) + "% of remixes are published" +
									"\nPublish Time: " + (p.correct_published_at||"").replace("T", " at ").replace("Z", " GMT") +
									"\nVersion: Editor " + p.version + ", Player " + (p.playerVersion||'1.0.0') + " (" + Object.keys(p.playerUpgrades||{}).length + " upgrades)" +
									"\nNumber of Scenes: " + (p.scenes||'_').length + ", Number of Objects: " + p.objects.length +
									"\n" + p.rules.length + " rules, " + p.abilities.length + " abilities " +
									"(" + (function(){var blocks = 0; p.abilities.forEach((x)=>{blocks += (x.blocks||[]).length;});return blocks;})() + " blocks)" +
									"\nNumber of Variables: " + (p.variables||'').length + ", Custom Images: " + (p.customObjects||'').length +
									"\nObject Scale: " + (p.baseObjectScale||1) + ", Font Size: " + (p.fontSize||80) + ", Stage Size: " + (p.stageSize||{"width": 1024}).width + "x" + (p.stageSize||{"height": 768}).height;
					var shown = false;
					p.objects.forEach(function(o){
						if (o.name == 'AE.webInfoText' && !shown) {
							alert(alertText + "\nCustom Description: " + o['text']);
							shown = true;
						}
					});
					if (!shown) alert(alertText);
				});
				break;
			case 3:
				window.open("../hs-builder/?loadUrl=" + p.uuid);
				break;
			case 4:
				$('#' + p.uuid).remove();
				break;
			case 5:
				getColorPallet(p.screenshot_url, false, p);
				break;
			case 6:
				showEmbeddedPlayer(p.uuid);
				break;
			case 7:
				window.open("../play-project/?id=" + p.uuid);
				break;
		}
	}
}

function getColorPallet(url, nomsg, p) {
	if (nomsg == undefined) nomsg = false;
	const colorThief = new ColorThief();
	const img = new Image();

	img.addEventListener('load', function() {
		if (!nomsg) console.groupCollapsed('Color Palette');
		if (!document.getElementById(p.uuid)) return;
		if (/*/https:\/\//gi.test(location.href) && */document.getElementById(p.uuid).getAttribute('data-show') != "false") Tesseract.recognize(img).then(function(result){
			if (!nomsg) console.log(result.text);
			var thumbnailRegex = /fan\s?art|\bimpossible\b|\bomg\b|\boh my\b|Cros[bs]y|\bDont\sdrop\s(your)?\s(phone|📱)|\bannouncement\b|\bnew account\b|\bshout\s*?outs?\b|\brequests?\b|\bpl[zs]\b|\bplease\b|\blike for part\b|\bfor a? follow\b|\bremix\b|\blike for\b|[0-9] likes\b|\blike\sbutton\b|\bfidget\b|\bspinner\b|(read|see) (in |the )? code|\bsubscribe to\b|\brepost\b|\bpl(s+|ease)\b|\blike for\b|\btoo many\b|\bi ship\b|\bships\b|\bignore\b|\b(that|the)? moment when\b|\bmy motto is\b|\bcome back for part\b|\bt?hat face\b/i;
			if (thumbnailRegex.test(result.text.replace(/\n/gi,' '))) {
				document.getElementById(p.uuid).setAttribute('data-show','false');
				console.log(`Project x-ray removal due to string match in thumbnail: ${result.text.replace(/\n/gi,' ').match(thumbnailRegex)}`);
				console.log(document.getElementById(p.uuid));
			}
		});
		if (!nomsg) console.log(url.replace(/.*\/|\..*/gi,''));
		var i = 0;
		var showProject = [true, true];
		var previousColors = [];
		
		//Sort by Percent of Image
		var colors = {};
		/*/JSON.parse('[['+/**/colorThief.getPalette(img)/*/+']]')/**/.forEach(function(x){
			colors['['+x+']'] = x[3];
		});
		colors = Object.keys(colors).sort(function(a,b){return colors[b]-colors[a]});
		var i = 0;
		colors.forEach(function(x){
			colors[i] = JSON.parse(x);
			i++;
		});
		i = 0;
		colors.forEach(function(x){
			if (!previousColors.includes(String(x))){
				var dist = Math.sqrt(Math.pow(214-x[0],2)+Math.pow(24-x[1],2)+Math.pow(103-x[2],2));
				if (!nomsg) console.log("%c" + x + '%c %c' + Math.round(dist*10)/10, 'background-color: rgb(' + String(x.slice(0,3)) + ');' + ((x[0] > 150 && x[1] > 150 && x[2] > 150) ? '' : 'color: white;'), '' , ((i < 3 && dist < 20) ? 'color: white; background-color: salmon;' : 'color: rgb(214,24,103);') );
				if (i < 3 && dist < 20) showProject[0] = false; //The "Pink" Rule
				if (i < 3 && x[3] > 0.97) showProject[1] = false; // The "97% BG" Rule
				if (x[3] >= 0.005) previousColors.push(String(x)); // Don't include color if it represents less than 0.5% of thumbnail
				i++;
			} else {
				if (!nomsg) console.log('%cDuplicate','color:orange');
			}
			/*
			PRESET CONSOLE TESTING CODE
			getColorPallet('https://s3.amazonaws.com/hopscotch-cover-images/production/10mjhmqqzn.png');
			getColorPallet('https://s3.amazonaws.com/hopscotch-cover-images/production/10moivzfh7.png');
			getColorPallet('https://s3.amazonaws.com/hopscotch-cover-images/production/10mop369bm.png');
			getColorPallet('https://s3.amazonaws.com/hopscotch-cover-images/production/10mocn8rsw.png');
			getColorPallet('https://s3.amazonaws.com/hopscotch-cover-images/production/10mo8uqz2f.png');
			getColorPallet('https://s3.amazonaws.com/hopscotch-cover-images/production/10mo66cdw3.png');
			*/
		});
		if (!nomsg) console.groupEnd();
		if (!nomsg) console.log('%c' + String(colors[0][3] + colors[1][3]), ((colors[0][3] + colors[1][3] > 0.97) ? 'color: red;': 'color: green;')); //"Strict 97" -- toggle?
		if (!nomsg) console.log(`%cpink %c97% %c${previousColors.length}` , ((showProject[0]) ? 'color: green': 'color: red'), ((showProject[1]) ? 'color: green': 'color: red'), ((previousColors.length > 2) ? 'color: green': 'color: red'));
		if (previousColors.length == 1 || (previousColors.length == 2 && colors[0][3] > 0.9 && Math.max(colors[0][0],colors[0][1],colors[0][2]) - Math.min(colors[0][0],colors[0][1],colors[0][2]) < 30 /*If the most common > 90% and Saturation is extremely low*/) || !showProject[0]) document.getElementById(p.uuid).setAttribute('data-show', 'false');
		if (p.number_of_stars > 50 && p.play_count > 20) try { document.getElementById(p.uuid).setAttribute('data-show', 'true') } catch (TypeError) { console.log('image no longer exists'); };
	});
	img.addEventListener('error',function(){console.error("Could not load image")});//throw new Error("Could not load image")})

	let imageURL = url;
	let googleProxyURL = (!/http/.test(location.protocol))?'https://api.allorigins.win/raw?url=':'https://images1-focus-opensocial.googleusercontent.com/gadgets/proxy?gadget=a&container=focus&refresh=86400&url=';

	img.crossOrigin = 'Anonymous';
	img.src = googleProxyURL + encodeURIComponent(imageURL);
}

var canAddPlayer = true;
function showEmbeddedPlayer(uuid) {
	if (canAddPlayer) {
		canAddPlayer = false;
		localStorage.removeItem("projectFromStorage"); //Make sure there is no data from storage when loading
		var playFrame = document.createElement('div');
		playFrame.id = "embed-container";
		playFrame.style = "display:block;position:fixed;width:100vw;height:100vh;left:0;bottom:-105%;transition:bottom 0.5s;z-index:100;overflow:auto;-webkit-overflow-scrolling:touch;";
		var src = ((uuid == "ae_web_info") ? "about.html?h="+window.innerHeight : "../play-project/index.html?id=" + uuid + "&play=1");
		playFrame.innerHTML = `<iframe id="project-player" src="${src}" style="position:absolute;display:block;width:100vw;height:100vh;border:none;top:0;left:0;z-index:1;"></iframe>
		<button onclick="removeEmbeddedPlayer()" id="close-player-btn" style="position:absolute;display:block;width:44px;height:44px;border-radius:4px;top:4px;left:4px;margin:2px;z-index:2;border:none;outline:none;background-color:rgba(0,0,0,0.54);cursor:pointer;"><i class='fa fa-close' style='color:white;font-size:32px;position:relative;top:-1px;left:-${Number(onIos)}px;'></i></button>`
		+ (uuid=="ae_web_info"?"":`<button onclick="toggleRender()" id="show-render-btn" style="position:absolute;display:block;width:44px;height:44px;border-radius:4px;top:4px;left:56px;margin:2px;z-index:2;border:none;outline:none;background-color:rgba(0,0,0,0.54);cursor:pointer;"><i class='fa fa-list-ul' style='color:white;font-size:32px;position:relative;top:0;left:-${4*Number(onIos)}px;'></i></button>`);
		document.body.appendChild(playFrame);
		setTimeout(function(){
			document.getElementById('embed-container').style.bottom = '0';
		},250);
		//Prevent the user from scrolling
		document.body.style.overflow = "hidden";
		document.body.ontouchmove = (e) => {e.preventDefault()};
	}
}
function removeEmbeddedPlayer() {
	document.getElementById('embed-container').style.bottom = '-105%';
	setTimeout(function(){
		document.getElementById('embed-container').remove();
		canAddPlayer = true;
	},500);
	//Re-enable scrolling
	document.body.style.overflow = "auto";
	document.body.ontouchmove = (e) => {void(0);};
	//$('body').off('touchmove');
	localStorage.removeItem("projectFromStorage");
}
function toggleRender() {
	var iframe = document.getElementById("project-player");
	if (/play-project\//.test(iframe.src)) {
		iframe.src = "../hs-builder/blockrender.html?id=" + iframe.src.replace(/.*id=/,"");
	} else {
		iframe.src = "../play-project/index.html?id=" + iframe.src.replace(/.*id=/,"");
	}
}

